import React from "react";

export default function Mmore(items){
    
    return(
        <>
        <div className="Container bg-light border" >
                {items.map(item=>(
                    <div key={items.name}>
                        <h3>
                        {item.strMeal}
                        </h3>
                        <img className="imgRecipe" src={item.strMealThumb} alt={item.strMeal}>
                        </img>
                        
                    </div>
                ))}
            </div>
            </>
    );

}
